import React, { useState } from 'react'; 
import { Link } from 'react-router-dom';
import '../assets/css/style-signup.css'; // Assuming your CSS file is named styles.css
import dnaImage from '../assets/img/DNA-Genetics.webp';

function Register() {
  const [isFlipped, setIsFlipped] = useState(false);
  const [profileImage, setProfileImage] = useState(null);

  const handleFlip = () => {
    setIsFlipped(!isFlipped);
  };

  const handleImageChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      const imageUrl = URL.createObjectURL(file);
      setProfileImage(imageUrl);
    }
  };

  const handleButtonClick = () => {
    document.getElementById("profile-picture").click(); // Trigger file input
  };

  return (
    <div className="container body">
      {/*<input type="checkbox" id="flip" checked={isFlipped} onChange={handleFlip} />
       <div className="cover">
        <div className={isFlipped ? 'front flipped' : 'front'}>
          <img src={dnaImage} alt="" />
        </div>
        <div className={isFlipped ? 'back flipped' : 'back'}>
          <img src={dnaImage} alt="" />
        </div>
      </div> */}
      <div className="forms">
        <div className="form-content">
          <div className={isFlipped ? 'signup-form flipped' : 'signup-form'}>
            <div className="title">Signup</div>
            <form action="#">
              <div className="input-boxes">
                <div className="input-box">
                  <i className=" fa-user"></i>
                  <input type="text" placeholder="Enter your name" required />
                </div>
                <div className="input-box">
                  <i className="fas fa-user"></i>
                  <input type="text" placeholder="Enter your profession" required />
                </div>
                <div className="input-box">
                  <i className="fas fa-envelope"></i>
                  <input type="text" placeholder="Enter your email" required />
                </div>
                <div className="input-box">
                  <i className="fas fa-lock"></i>
                  <input type="password" placeholder="Enter your password" required />
                </div>
                <div className="input-box">
                  <i className="fas fa-lock"></i>
                  <input type="password" placeholder="Re-type password" required />
                </div>
                <div className="button input-box">
                  <Link to="/dashboard"><input type="submit" value="Submit"/></Link>
                </div>
                <div className="text sign-up-text">
                  Already have an account?{' '}
                  <Link to="/login" htmlFor="flip">Login now</Link>
                </div>
              </div>
            </form>
          </div>

          {/* Profile Image Section */}
          <div className="profile-section">
            {/* <div className="profile-picture">
              {profileImage ? (
                <img src={profileImage} alt="Profile" className="profile-img" />
              ) : (
                <div className="profile-placeholder">Profile Picture</div>
              )}
            </div> */}
            <input 
              type="file" 
              accept="image/*" 
              id="profile-picture" 
              onChange={handleImageChange} 
              className="file-input-hidden" 
            />
            <button type="button" className="custom-file-button profile-picture" onClick={handleButtonClick}>
                {profileImage ? (
                  <img src={profileImage} alt="Profile" className="profile-img" />
                ) : (
                  <div className="profile-placeholder">Profile Picture</div>
                )}
            </button>
          </div>

        </div>
      </div>
    </div>
  );
}

export default Register;
